import React from "react";
import { ReactDOM } from "react";

class Human extends React.Component {
  // super(props)を定義してからでないとthis.state等でprops内の値を新規追加出来ないから。
  constructor(props) {
    super(props);
  }
}

export const ReactComponent = ({ text, music }) => {
  return (
    <div>
      {text}
      {music}
    </div>
  );
};
